import React from 'react';


function Steps(props) {
  console.log(props.history);
  const steps = props.history.map((step, i) => {
  	return(
  		<button>move#{i}</button>
  	)
  })
  return (
    <div>
    	{steps}
    </div>
  );
}

export default Steps;
